import Header from "./NavComponents/navigation";
import bgVideo from "../images/bg.mp4";

const titleStyle = {
  display: "flex",
  flexDirection: "column",
  justifyContent: "center",
  alignItems: "flex-start",
  padding: "0px",
  gap: "6px",

  position: "absolute",
  width: "670px",
  height: "495px",
  left: "122px",
  top: "184px",
};

const h1Style = {
  fontFamily: "'DM Sans', sans-serif",
  fontStyle: "normal",
  fontSize: "80px",
  fontWeight: "500",
  lineHeight: "110%",
  letterSpacing: "-0.03em",
  color: "#1b262c",
};

const bgStyle = {
    width: '100%',
    height: '100%',
    objectFit: 'cover',
    position: 'absolute',
    top: '82px',
    left: '0',
    index: '-1'
}

export default function Home() {
  return (
    <div>
      <Header />
      <div>
        <video
          src={bgVideo}
          style={bgStyle}
          autoplay="autoplay"
          loop="loop"
          muted="muted"
        ></video>
        <div id="title" style={titleStyle}>
          <h1 style={h1Style}>Health Misinformation Detective</h1>
          <p>
            We've done it carefully and simply. Combined with the ingredients
            makes for beautiful landings. It is definitely the tool you need to
            speed up your design process.
          </p>
          <h2 id="button">Explore</h2>
        </div>
      </div>
    </div>
  );
}

let backgroundStyle = document.getElementsByTagName("body");
backgroundStyle[0].style["background-color"] = "#F3F9FB";
